    tech: ["Ruby on Rails"]
  },
  {
    title: "WeManage: Real Estate Asset Management",
    description: "Mobile application for realtors in Japan to securely manage property info and income predictions.",
    image: mock02,
    link: "http://www.wemanage.jp/",
    category: "Software Systems",
    tech: ["Ruby on Rails", "JavaScript"]
  },
  {
    title: "Multiple Regression Property Analysis",
    description: "Analyzed real estate market in Japan and predicted prices using OLS and multi-regression analysis.",
    image: mock01,
    link: "https://github.com/yujisatojr/multi-reg-analysis",
